import Layout from "../Layout";

export default function FAQ() {
  return (
    <Layout>
      <div
        class="[gap:1em;
border:3px_solid_#555BFF;
box-shadow: 10px -10px 0 -3px #f5f5f5, 10px -10px #1FC11B, 20px -20px 0 -3px #f5f5f5, 20px -20px #FFD913, 30px -30px 0 -3px #f5f5f5, 30px -30px #FF9C55, 40px -40px 0 -3px #f5f5f5, 40px -40px #FF5555;
transition: box-shadow 1s, top 1s, left 1s;]"
      ></div>
    </Layout>
  );
}
